لقيمات بالشعيريه🐣
المقادير : 
كوبين و نص دقيق - نص كوب حليب بودره -ملعقه كبيره خميره فوريه -ملعقه كبيره سكر -ملعقه صغيره باكينج باودر - رشه ملح - 1/4 كوب زيت نباتي -كوب مويه دافيه 
نعجنها بالعجانه ونتركها تتخمر ساعه كامله وبعدها نحشيها كيري ونسويها دوائر نغمسها في حليب سائل
وبعدها شعيريه باكستانيه مكسر ناعم
ونقليها بالزيت 
للزينه ؛ 
حليب مكثف محلى نستله .
